import React, { useState, useCallback } from 'react';
import './App.css';
import MainLayout from './components/Layout/MainLayout';
import ChatBox from './components/ChatBox/ChatBox';
import SampleDataDisplay from './components/DataTable/SampleDataDisplay';
import ResponseDisplay from './components/ResponseDisplay/ResponseDisplay';
import { useLocalStorage } from './hooks/useLocalStorage';
import { useApi } from './hooks/useApi';

function App() {
  const [messages, setMessages] = useLocalStorage('chat-messages', []);
  const [currentResponse, setCurrentResponse] = useState(null);
  const [isLoading, setIsLoading] = useState(false);
  const { sendQuery } = useApi();

  const handleSendMessage = useCallback(async (message) => {
    // Add user message to chat
    const userMessage = {
      id: Date.now(),
      type: 'user',
      content: message,
      timestamp: new Date().toISOString()
    };

    setMessages(prev => [...prev, userMessage]);
    setIsLoading(true);
    setCurrentResponse(null);

    try {
      // Send to backend
      const response = await sendQuery(message);

      // Add assistant response
      const assistantMessage = {
        id: Date.now() + 1,
        type: 'assistant',
        content: response.message || '',
        data: response.data || null,
        charts: response.charts || null,
        timestamp: new Date().toISOString()
      };

      setMessages(prev => [...prev, assistantMessage]);
      setCurrentResponse(assistantMessage);
    } catch (error) {
      console.error('Error sending message:', error);

      // Add error message
      const errorMessage = {
        id: Date.now() + 1,
        type: 'error',
        content: 'Failed to get response. Please try again.',
        timestamp: new Date().toISOString()
      };

      setMessages(prev => [...prev, errorMessage]);
    } finally {
      setIsLoading(false);
    }
  }, [sendQuery, setMessages]);

  const handleClearChat = useCallback(() => {
    setMessages([]);
    setCurrentResponse(null);
  }, [setMessages]);

  return (
    <div className="App min-h-screen bg-gradient-to-br from-gray-50 to-gray-100">
      <MainLayout>
        <div className="container mx-auto px-4 py-6">
          <div className="grid grid-cols-1 lg:grid-cols-3 gap-6 h-[calc(100vh-120px)]">

            {/* Left Column - Sample Data */}
            <div className="lg:col-span-1 space-y-4 overflow-y-auto">
              <div className="bg-white rounded-xl shadow-lg p-6">
                <h2 className="text-xl font-semibold mb-4 text-gray-800">
                  Sample Data Overview
                </h2>
                <SampleDataDisplay />
              </div>
            </div>

            {/* Middle Column - Chat Interface */}
            <div className="lg:col-span-1 flex flex-col">
              <div className="bg-white rounded-xl shadow-lg flex-1 flex flex-col overflow-hidden">
                <div className="border-b px-6 py-4 flex justify-between items-center">
                  <h2 className="text-xl font-semibold text-gray-800">
                    Analytics Chat
                  </h2>
                  <button
                    onClick={handleClearChat}
                    className="text-sm text-gray-500 hover:text-gray-700 transition-colors"
                  >
                    Clear Chat
                  </button>
                </div>
                <ChatBox
                  messages={messages}
                  onSendMessage={handleSendMessage}
                  isLoading={isLoading}
                />
              </div>
            </div>

            {/* Right Column - Response Display */}
            <div className="lg:col-span-1 overflow-y-auto">
              <div className="bg-white rounded-xl shadow-lg p-6 min-h-full">
                <h2 className="text-xl font-semibold mb-4 text-gray-800">
                  Analysis Results
                </h2>
                {currentResponse ? (
                  <ResponseDisplay response={currentResponse} />
                ) : (
                  <div className="text-center text-gray-400 mt-12">
                    <svg
                      className="mx-auto h-12 w-12 mb-4"
                      fill="none"
                      viewBox="0 0 24 24"
                      stroke="currentColor"
                    >
                      <path
                        strokeLinecap="round"
                        strokeLinejoin="round"
                        strokeWidth={2}
                        d="M9 19v-6a2 2 0 00-2-2H5a2 2 0 00-2 2v6a2 2 0 002 2h2a2 2 0 002-2zm0 0V9a2 2 0 012-2h2a2 2 0 012 2v10m-6 0a2 2 0 002 2h2a2 2 0 002-2m0 0V5a2 2 0 012-2h2a2 2 0 012 2v14a2 2 0 01-2 2h-2a2 2 0 01-2-2z"
                      />
                    </svg>
                    <p>Ask a question to see analysis results</p>
                  </div>
                )}
              </div>
            </div>

          </div>
        </div>
      </MainLayout>
    </div>
  );
}

export default App;
